import { collection, getDocs, query, where } from "firebase/firestore";
//, setDoc, serverTimestamp 

export default {
    async receive_data(uid) {
        const downloadTask = await getDocs(collection(firestore, `userData/${uid}`));
        console.log(downloadTask);
    },
}
